import './App.css';
import Video from './component/video';
import data from './component/data/data';
import { useState } from 'react';
import AddVideo from './component/addVideo';


function App() {

  console.log('App Render')

 const [video, setVideo] = useState(data);


 function VideoItem() {
    setVideo({
      id: video.length + 1,
      title: 'React tutorial',
      channelName: 'Nurmagomedov',
      isVerified: true,
      view: '12M',
      time: '2 years ago',
  })
 }






  return (
    <>
        <div className='container'>



      {data.map(video => {

        return <Video
        id={video.id}
        key={video.id}
        title={video.title}
        channelName={video.channelName}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>

      })}
      <AddVideo onClick={() => VideoItem()}></AddVideo>
    </div>

    </>


  );
}

export default App;
